import {styled} from 'styled-components';

function Wrapper(props) {
  const Wrapper = styled.div`
  width: 640px;
  min-width: 320px;
  height: 100vh;
  margin: 0]2 auto;
`
  return <Wrapper>
    {props.children}
  </Wrapper>
}
export default Wrapper;
